import fetch from "node-fetch";

async function run() {
    const data = JSON.stringify({transaction_payload: ""})

    const response = await fetch("https://stacks-node-api.mainnet.stacks.co/v2/fees/transaction", {
        method: 'POST',
        mode: 'cors',
        cache: 'no-cache',
        credentials: 'same-origin',
        headers: {
          'Content-Type': 'application/json'
        },
        redirect: 'follow',
        referrerPolicy: 'no-referrer',
        body: data
    });
    
    console.log(response)
}

run()